function render_section(){document.querySelectorAll("._render_section").forEach((e=>{let n=null!==e.firstChild?e.firstChild.outerHTML:null,t="";null!==n&&(t=`\n        <div class="py-3 my-3 border_deshed border-1"> \n          ${n}\n        </div>\n      `,e.removeChild(e.firstChild));const s=e.dataset;let d=0==s.details_title.includes("#")?`<p class="my-1">${s.details_title}</p>`:function(e){let n="";return e.split("#").filter((e=>""!==e.trim())).forEach((e=>{0!==e.length&&(n+=`<p class="my-1">${e}</p>`)})),n}(s.details_title);e.insertAdjacentHTML("beforeend",`\n    <div class="mb-5 py-3 bg_info border border-dark border-1 border-start-0 border-end-0">\n      <div class="container-lg">\n        <div class="row px-3">\n          <div class="d-flex justify-content-between align-items-center mb-3 p-0">\n            <h2 class="fs21 d-flex m-0">${s.header}</h2>\n            <button class="btn btn-success d-inline-flex align-items-center _btn_view_code" data-objec_key="${s.objec_key}" data-view_code_key="${s.view_code_key}" data-bs-toggle="modal" data-bs-target="#exampleModal" data-bs-whatever="@mdo">\n              <span class="me-2">View code</span>\n              <ion-icon class="wh21px" name="code-working"></ion-icon>\n            </button>\n          </div>\n          <div class="py-3 border_deshed border-1">\n            <details>\n              <summary class="fs18"><span class="d-inline-flex align-items-center">Details</span></summary> \n              ${d} \n            </details>\n          </div>\n          ${t}   \n        </div>\n      </div>\n    </div>\n  `)}))}export default render_section;